const rule = {
  Url: 0,
  ActionCategory: 1,
  ClassJob: 2,
  ClassJobLevel: 3,
  Recast100ms: 4,
  MaxCharges: 5,
  ClassJobCategory: 6,
};

function createIconUrl(icon) {
  if (!icon) return;
  let head = [..."000000"];
  let iconStr = icon.toString();
  if (iconStr.length > 3) {
    const temp = [...iconStr].slice(0, iconStr.length - 3).concat(..."000");
    head = [...head.slice(0, 6 - temp.length), ...temp];
  }
  let foot = [..."000000"];
  foot = [...foot.slice(0, 6 - iconStr.length), ...iconStr];
  return `${head.join("")}/${foot.join("")}`;
}

class Action {
  constructor(id, level) {
    const action = actions[id] || new Array(7).fill("");
    this.ID = id;
    this.Name = actionChinese[id] ?? "无";
    this.Url = createIconUrl(action[rule.Url]);
    this.ActionCategory = action[rule.ActionCategory];
    this.ClassJobLevel = action[rule.ClassJobLevel];
    this.Recast100ms = getTrait(this.ID, "Recast100ms", level);
    this.MaxCharges = getTrait(this.ID, "MaxCharges", level);
    this.ClassJob = action[rule.ClassJob];
    this.Useful = level >= this.ClassJobLevel;
    this.ClassJobCategory =
      ClassJobCategoryConvert.get(
        action[rule.ClassJobCategory].toString()
      )?.split(/[ 、]/) ?? [];
  }
}

